import { createSlice } from "@reduxjs/toolkit";

const firstSlice = createSlice({
    name : 'userslice',
    initialvalue : {
        name : ''
    },
    reduces : {
        nameChange : (state) => {
            state.name = "Divya"
        }
    }
})

export const { nameChange } = firstSlice.actions

export default firstSlice.reducer
